package com.imooc;
public class Books {
	public int num;
	public String name;
	public Books(int num, String name) {
		// TODO Auto-generated constructor stub
		this.num = num;
		this.name = name;
	}
	public int getNum() {
		return num;
	}
	public void setNum(int num) {
		this.num = num;
	}
	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	
}
